script: |
  super -f text -I q3931.spq | sort > q3931.out

inputs:
  - name: q3931.spq
    data: |
      SELECT DISTINCT - 20 + col0 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col0 * - 94 * + - 69 NOT BETWEEN - 22 AND ( col0 * - col2 + + - col1 + + col0 * + ( + + 11 ) );
  - name: tab1

outputs:
  - name: q3931.out
    data: |
      31
      65
      71
